import { FC } from "react";
import { OrderResponse } from "../types/order-response-type";

type TradeListProps = {
  marketPrice: number;
  tradeList: OrderResponse[];
};

export const TradeList: FC<TradeListProps> = ({ tradeList, marketPrice }) => {
  return (
    <div className="bg-white rounded-md min-h-60 max-h-60 w-3/4">
      <div className="flex justify-between p-2 font-bold">
        <p>Trade</p>
        <p>Order Type</p>
        <p>Asset</p>
        <p>Amount</p>
        <p>Price</p>
        <p>Total</p>
      </div>
      <div className="overflow-y-scroll h-4/5 pb-2 ">
        {!tradeList.length && (
          <div className="flex justify-center items-center h-full">
            <p className="font-semibold">No Trades</p>
          </div>
        )}
        {tradeList.map((trade, idx) => {
          return (
            <div key={idx} className="flex p-2 text-sm font-semibold">
              <div>
                <p
                  className={`${
                    trade.side === "BUY" ? "text-green-500" : "text-red-500"
                  }`}
                >
                  {trade.side}
                </p>
                <p>{trade.type}</p>
              </div>
              <div>
                <p>{trade.asset}</p>
              </div>
              <div>
                <p>{trade.quantity}</p>
              </div>
              <p>${trade.type === "LIMIT" ? trade.price : marketPrice}</p>
              <p>${trade.notional}</p>
            </div>
          );
        })}
      </div>
    </div>
  );
};
